import React from "react";
class Display extends React.Component {

	// Constructor
	constructor(props) {
		super(props);

		this.state = {
			items: [],
			DataisLoaded: false,
            error:null
		};
	}

	componentDidMount() {
		fetch(
"https://jsonplaceholder.typicode.com/todos")
			.then((res) => res.json())
			.then((json) => {
				this.setState({
					items: json,
					DataisLoaded: true,

				});
			},
            (error) => {
                this.setState({
                  isLoaded: true,
                  error:error
                });
              }
            )
	}
	render() {
		const {error, DataisLoaded, items } = this.state;

        if(error){
            return <div>Error: {error.message}</div>
        }
		else if (!DataisLoaded)
         return <div>Loading...</div>;

		return (
            <ul>
            {items.map(item => (
              <li key={item.id}>
                User Id : {}
              </li>
            ))}
          </ul>
	);
}
}

export default Display;
